description:
The Felice Brothers are a folk rock/country rock band from Upstate New York founded in 2006

The Felice Brothers is the Brothers' debut in &quot;brick and mortar&quot; retailers in America as the brothers have said it. The Felice Brothers was released on March 4, 2008. It includes five tracks previously released on their hard to find Adventures of the Felice Brothers Vol. 1.

